function drawVisualization(){if(void 0!==rx_admin_params.reports_sales_by_package){var a=google.visualization.arrayToDataTable(JSON.parse(rx_admin_params.reports_sales_by_package)),e={title:"Sales by package",curveType:"function",legend:{position:"bottom"}};new google.visualization.LineChart(document.getElementById("chart_div")).draw(a,e)}}google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(drawVisualization);